import React from "react";
import routes from "./Routes/Index";
import { Route, BrowserRouter, Switch } from "react-router-dom";
function App() {
  const show = (routes) => {
    if (routes.length > 0) {
        routes.map((route, index) => {
        return (
          <Route
            key={index}
            path={route.path}
            component={route.main}
            exact={route.exact}
          />
        );
      });
    }
  };
  return (
    <BrowserRouter>
      <Switch>{show(routes)}</Switch>
    </BrowserRouter>
  );
}

export default App;
